import fox_blep from "../../assets/img/fox_blep.jpg";
import classes from "./Contacts.module.css";

function Contacts(props) {
    return (
        <div className={`${classes.ContactsMain}`}>
            <img src={fox_blep} className={`${classes.avatar}`} alt={`avatar`}/>
            <a
                className={`${classes.link}`}
                href="https://github.com/Jonesso"
                target="_blank"
                rel="noopener noreferrer"
            >
                My GitHub portfolio
            </a>
            <p>{props.year} &copy;S.Pavlinina</p>
        </div>
    );
}

export default Contacts;
